    },
    {
      "orient": "left", "zindex": 1,
      "scale": "Horsepower", "title": "Horsepower",
      "offset": {"scale": "ord", "value": "Horsepower", "mult": -1}
    },
    {
      "orient": "left", "zindex": 1,
      "scale": "Acceleration", "title": "Acceleration",
      "offset": {"scale": "ord", "value": "Acceleration", "mult": -1}
